import React from 'react';
import styles from './Card.module.css'

const Card = ( {movies} ) => {
    return (
        <>
            { movies.map( ( x ) =>{
                return (
                    <>

                    <div className={styles.container__card}>
                
                        <img src="" alt="" />
                        <h3></h3>
                        <p></p>
                        
                    </div>

                    </>
                )
                }
            )
            }

        </>
    );
}

export default Card;
